      SELECT ALL col1 * col1 * col2 + + tab0.col1 * col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - col0 * - col0 + col1 + col1 NOT BETWEEN col2 + col0 AND col0;
  - name: tab0

outputs:
  - name: q9346.out
    data: |
